#include <stdio.h>
#include <stdbool.h>

unsigned fibonacci(bool reset) {
    static unsigned n1 = 0;
    static unsigned n2 = 1;

    if(reset) {
        n1 = 0;
        n2 = 1;
    }

    unsigned retval = n1;

    n2 += n1;
    n1 = n2 - n1;

    return retval;
}
 
int main() {
    for(size_t i = 0; i < 20; ++i) {
        if(i == 10) printf("\n-- reiniciando --\n");
        printf("%u\n", fibonacci(i == 10));
    }
}

public class Persona implements Serializable {
    @Serial
    private static final long serialVersionUID = 4538351578342208061L;
    private String nombre;
    private String apellido;
    private String ciudad;
    private String nacionalidad;
    private int edad;

    public Persona() {

    }

    public Persona(String nombre) {
        this.nombre = nombre;
    }

    public Persona(
            String nombre,
            String apellido,
            String ciudad,
            String nacionalidad,
            int edad) {
        this.nombre = nombre;
        this.apellido = apellido;
        this.ciudad = ciudad;
        this.nacionalidad = nacionalidad;
        this.edad = edad;
    }

    // Getters
    public String getNombre() {
        return nombre;
    }

    public String getApellido() {
        return apellido;
    }

    public String getCiudad() {
        return ciudad;
    }

    public String getNacionalidad() {
        return nacionalidad;
    }

    public int getEdad() {
        return edad;
    }

    //Setters
    public void setNombre(String nombre) {
        this.nombre = nombre;
    }

    public void setApellido(String apellido) {
        this.apellido = apellido;
    }

    public void setCiudad(String ciudad) {
        this.ciudad = ciudad;
    }

    public void setNacionalidad(String nacionalidad) {
        this.nacionalidad = nacionalidad;
    }

    public void setEdad(int edad) {
        this.edad = edad;
    }

    public String imprimePersona() {

        return "Nombre: " +
                nombre + "\n" +
                "Apellido: " +
                apellido + "\n" +
                "Ciudad: " +
                ciudad + "\n" +
                "Nacionalidad: " +
                nacionalidad + "\n" +
                "Edad: " +
                edad + "\n";
    }

    public void imprimePersonaBinario(String nombre, String apellido, String ciudad, String nacionalidad, int edad) {
        System.out.printf("Nombre: %s %nApellido: %s %nCiudad: %s %nNacionalidad: %s %nEdad: %d %n %n",
                nombre, apellido, ciudad, nacionalidad, edad);
    }
}

