	static int arr[NMAX];
	for (int i = 0; i < n; i++) {
		assert(scanf_s("%d", &arr[i]));
	}
	bSort(arr, n, sizeof(int), cmpInts);
	for (int i = 0; i < n; i++) {
		printf("%d ", arr[i]);
	}
	putchar('\n');
	return 0;
}

